import './main-panel-item.css';

export const MainPanelItem = (key, name, age, hometown, editIcon, deleteIcon, onClickEdit, onClickDelete) => {
    return (
        <div key={key} className='list-item'>
            <div className='list-item-data'>
                <p>{name}</p>
                <p>{age}</p>
                <p>{hometown}</p>
            </div>
            <div className='icon-container'>
                <img src={editIcon} alt="icon" className='edit'  onClick={() => onClickEdit(itemKey)}/>
                <img src={deleteIcon} alt="icon" className='delete' onClick={() => onClickDelete(itemKey)}/>
            </div>
        </div>
    )
}
